import React, { useState } from "react";
import { Form, Link, Button } from "antd";

const LoginForm = () => {
  return (
    <Form>
      <div>
        <label htmlFor="user-id">아이디</label>
        <br />
        <input
          name="user-id"
          // value={userId}
          // onChange={onChangeId}
          required
        />
      </div>
      <div>
        <label htmlFor="user-password">비밀번호</label>
        <br />
        <input
          name="user-password"
          type="text"
          // value={password}
          required
          // onChange={onChangePassword}
        />
      </div>
      <div>
        <Button type="primary" htmlType="submit" loading={false}>
          로그인
        </Button>
        <Link href="/signup">
          <a>
            <Button>회원가입</Button>
          </a>
        </Link>
      </div>
    </Form>
  );
};

export default LoginForm;
